</h2><br>Le but de cette section est de vous apprendre à créer un projet basique sous Android Studio. Un projet basique contient déjà un exemple de projet minimaliste qui permet de tester rapidement le déploiement d'un projet Android.<br><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Création du projet basique:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
